    false,nt"url": null,nt"notes": "The purpose of this investigation was to
    determine if endocrine disrupting contaminants were present in adult, hatchling
    and embryonic green sea turtles (Chelonia mydas) and nest sand. Presence or absence
    of these compounds was assessed as to correlation with fibropapilloma (FP) occurrence,
    abnormal tissues, abnormal steroids, and/ or unusual blood chemistry in the same
    animal or in the mother. This project was not accomplished as proposed due to a
    flood that occurred on the University of Hawaii-Manoa campus. The flood caused a
    many-day power outage that resulted in the loss of all samples stored in freezers
    in buildings affected by the outage. At the time of the flood, only a few of the
    samples had been analyzed. Different people in the lab were analyzing different
    media, so we have analytical data for some nest sand, some turtle blood, but no
    eggs; and only PCB analyses. A second major component of the investigation included
    a concurrent graduate thesis nesting study on Tern Island. The nesting study provided
    valuable information on maternal investment and data on egg composition (protein,
    lipid, etc).",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
